import React from 'react';
import { Navigate } from 'react-router';



function Info(props){
    if(JSON.parse(localStorage.getItem("userName"))[0]==undifighd)
    {
        let user=JSON.parse(localStorage.getItem("userName"))[0];
    }
    else{
        navigate("/Main");
    }
 
return(
<div>
<h3>name: {user.name}</h3>
<h3>address: {user.address.street} {user.address.suite} {user.address.city}</h3>
<h3>email: {user.email}</h3>
<h3>phone: {user.phone}</h3>
<h3>website: {user.website}</h3>
<h3>company name: {user.company.name}</h3>
<h3>company catchPhrase: {user.company.catchPhrase}</h3>
<h3>company bs: {user.company.bs}</h3>

</div>
);
}
export default Info;
